INSERT INTO `admin_product` VALUES ('10180', '徐工XE470C_测试', '1435025498', 'http://101.200.174.101/upload/99c5dc7a-1a3d-4c77-943e-c799ce41cb4f.jpg', null, null, null, null, '操作重量', '46,100 kg', '接地比压', '82.7 kPa', '离地间隙', '703 mm', '发动机', 'Cummins QSM11', '额定功率', '250 kw', '挖掘高度', '10675 mm', '行走系统压力', '34.3 kPa', '液压油箱容积', '360 L', '斗容', '2.2 岩石斗', '安全阀压力', '31.4/34.3 kPa', '<p>	</p><p><br/></p><p><br/></p><p><br/></p><p><br/></p><p><br/></p><p><br/></p><p><br/></p><p><br/></p><p><br/></p><p><br/></p><p style=\"text-align: center;\"><img style=\"width: 638px; height: 395px;\" title=\"1435026423233038522.jpg\" alt=\"1368003501065.jpg\" src=\"http://101.200.174.101/upload/ueditor/20150623/1435026423233038522.jpg\" width=\"898\" height=\"314\"/></p><p>&nbsp;</p><p>&nbsp;</p><p><span style=\"background-color: rgb(255, 255, 0);\"><strong>产品特点：&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong></span></p><p><strong>一、高端配置，性能卓越<br/></strong>1、原装进口新一代康明斯发动机，动力强劲，低噪音，低油耗，低排放，更可靠。<br/>2、采用成熟可靠的负流量控制系统，通过双泵合流，增加多路阀提供给各动作油缸的流量分配，从而保持强大的挖掘能力和优异的作业效率。<br/>3、采用先进全铝制板翘式散热器，散热器采用并联加串联冷却方式，风流通畅，流速快，散热效果好，系统工作温度稳定，使用寿命长。<br/>4、性能优异可靠的电控系统，最大限度地利用发动机功率，保证机器快速高效运作。<br/>5、通过使用最新型滤芯，提高了过滤性能。通过三级过滤模式保证了进油质量，提高了发动机在恶劣工况下运行的可靠性，更适合国内广大地区使用。<br/>6、使用大容量的空气滤清器，使用寿命长，易于维护保养，进气口带有网罩，即使在粉尘较多的环境中也能保证进气质量，使发动机有效的工作。<br/><strong>二、高品质驾驶享受<br/></strong>1、全新宽敞明亮的驾驶室，使操作更舒心愉悦；同时对脚踏进行了改进， \r\n使操作更加舒适轻松。<br/>2、基于人机工程学理念而设计的新式悬浮座椅，为操作人员长时间作业提供充分的支撑保证。<br/>3、驾驶室中央支柱采用高强度的封闭式截面结构，增加了驾驶室整体强度和刚度，提高了安全性。<br/>4、采用密封防震硅油橡胶，进一步降低了驾驶室的震动和内部噪音，减轻了操作人员的疲劳。<br/><strong>三、坚固高效，持久耐用<br/></strong>1、防撞型上部回转平台，由加强钢板焊接而成的坚固箱体结构，经久耐用； &nbsp;\r\n结合采用D型平台边梁，有效降低冲击力度，防止平台变形。<br/>2、大幅增强的下部行走体，使其拥有强大的行走牵引力和较小的接地比压，在恶劣的环境下作业行走自如。<br/>3、履带单边安装有三个夹轨器，可减少转向时履带链轨的偏移；同时加长型履带和单边9个支重轮的配置，增加了整机的稳定性，使挖掘力能充分发挥；加强型履带板，有效提升了重载挖掘时的耐久性。<br/>4、采用日本知名品牌的强化树脂止推片，有效降低了工作装置连接部的噪音，使用寿命提高两倍。<br/>5、前端连接部采用高硬度的T型轴套，大幅降低了接触表面的磨损。<br/>6、标配的大容量岩石铲斗采用了美国著名公司爱斯科专利技术生产的斗齿，其耐磨性和使用寿命均提高一倍以上。<br/>7、拥有专利技术的回转防尘机构，有效防止灰尘、油污等进入，确保机器快速作业、高效可靠。<br/><strong>四、便捷的维修保养<br/></strong>1、发动机以及保养部件设置在伸手可及之处，保养方便，同时节省维修时间，提高了工作效率；散热器和油冷却器以平行排列的形式安装，便于对两者的清洁和拆卸；散热器外部设置有防护网，有效防止飞絮等杂物吸入。<br/>2、大容量工具箱增加储藏空间。<br/>3、动臂根部采用自润滑轴承，可获得良好的润滑性，且延长了注入润滑脂的时间间隔。<br/>4、燃油箱容量增加至650L，增大了加油间隔，并标配有加油泵 \r\n。<br/><span style=\"color: rgb(4, 71, 152);\">• \r\n<strong>选配部分</strong></span><br/>1、可根据用户的需求，配置其他作业装置，如：长动臂、长斗杆、深挖斗、抓料斗、破碎锤、液压剪等。<br/>2、铲斗标配2.2m³的岩石斗；可选配2.3m³的岩石斗和2.5m³的土方斗。</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p><br/></p><p><br/></p><p><br/></p><p><br/></p><p><br/></p><p><br/></p><p><br/></p><p><br/></p><p><br/></p><p><br/></p><p>	</p>', '200000.00', '400000.00', '10198', '已上线', '10004', '10171', '10173', '经销商', '1');
