INSERT INTO `admin_xinxi` VALUES ('10009', '新媒体人”缘何被列为统战重点团结对象？', '1432368201', '<h1 class=\"h2 fz-25 YH\" style=\"margin: 0px; padding: 0px; font-size: 25px; font-weight: normal; font-family: &#39;Microsoft YaHei&#39;, SimHei; line-height: 56px; white-space: normal; background-color: rgb(255, 255, 255);\"><span class=\"cor666 mar-r-10 lh-36\" id=\"pubtime_baidu\" style=\"margin-right: 10px; color: rgb(102, 102, 102); line-height: 36px; font-family: 宋体, sans-serif; font-size: 12px;\">2015-05-23 09:10:00</span><span style=\"font-family: 宋体, sans-serif; font-size: 12px;\">&nbsp;</span><span id=\"source_baidu\" class=\"mar-r-10 lh-36\" style=\"margin-right: 10px; line-height: 36px; font-family: 宋体, sans-serif; font-size: 12px;\">来源：<a href=\"http://www.bjnews.com.cn/news/2015/05/21/364265.html\" target=\"_blank\" style=\"color: rgb(37, 37, 37); text-decoration: none;\">新京报</a></span><span style=\"font-family: 宋体, sans-serif; font-size: 12px;\">&nbsp;</span><span id=\"editor_baidu\" class=\"lh-36\" style=\"line-height: 36px; font-family: 宋体, sans-serif; font-size: 12px;\">责任编辑：</span></h1><p><span style=\"font-family: 宋体, sans-serif; font-size: 12px; background-color: rgb(255, 255, 255);\"></span></p><p style=\"margin-bottom: 0px; padding: 0px 0px 15px; text-align: center;\"><a href=\"http://www.cankaoxiaoxi.com/roll/roll10/2015/0523/791510_2.shtml\" target=\"_self\" style=\"color: rgb(51, 102, 153); text-decoration: none;\"><img src=\"http://upload.cankaoxiaoxi.com/2015/0523/1432344460560.jpg\" style=\"vertical-align: top; border-width: 0px; margin: 0px auto; max-width: 500px;\"/></a></p><p style=\"margin-top: -10px; margin-bottom: 0px; padding: 0px; line-height: 12px; text-align: center; text-indent: 2em; font-size: 12px;\"><br/></p><p style=\"margin-bottom: 0px; padding: 0px 0px 15px; font-size: 12px;\"><span style=\"font-family: 宋体, sans-serif; line-height: 30px; background-color: rgb(255, 255, 255);\">5月18日至20日，中央统战工作会议在北京举行。中共中央总书记、国家主席、中央军委主席习近平在会上发表重要讲话。 新华社记者马占成摄</span><br/></p><p style=\"margin-bottom: 0px; padding: 0px 0px 15px; line-height: 30px; text-indent: 2em; font-family: 宋体, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">新京报快讯（记者王姝）中国革命三大法宝之一“统一战线”，首次将“新媒体中的代表性人士”列为重点团结对象。昨日闭幕的中央统战工作会议，透露这一信息。</p><p style=\"margin-bottom: 0px; padding: 0px 0px 15px; line-height: 30px; text-indent: 2em; font-family: 宋体, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\"><strong>在中央统战工作会议上，习近平总书记讲话时提到，三类人将成重点团结对象：“留学人员”（留学人员成为统战工作新的着力点）、“新媒体中的代表性人士”和“非公有制经济人士特别是年轻一代”。</strong>谈到“新媒体中的代表性人士”时，习近平要求，“要加强和改善对新媒体中的代表性人士的工作，建立经常性联系渠道，加强线上互动、线下沟通，让他们在净化网络空间、弘扬主旋律等方面展现正能量”。</p><p style=\"margin-bottom: 0px; padding: 0px 0px 15px; line-height: 30px; text-indent: 2em; font-family: 宋体, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">这是习近平在统战工作中首次提到“新媒体中的代表性人士”，意味着“巩固发展最广泛的爱国统一战线”将“新媒体中的代表性人士”列为重要团结人群。</p><p style=\"margin-bottom: 0px; padding: 0px 0px 15px; line-height: 30px; text-indent: 2em; font-family: 宋体, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">十八大以来，中央高度重视新型媒体发展，成立了中央网络安全和信息化领导小组，并举行了世界互联网大会。习近平则多次在讲话中，对新媒体发展作出部署。</p><p style=\"margin-bottom: 0px; padding: 0px 0px 15px; line-height: 30px; text-indent: 2em; font-family: 宋体, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">2013年8月19日，在全国宣传思想工作会议上，习近平首次重点强调了新媒体的作用，“（宣传工作）要适应社会信息化持续推进的新情况，加快传统媒体和新兴媒体融合发展，充分运用新技术新应用创新媒体传播方式，占领信息传播制高点”。去年2月27日在中央网络安全和信息化领导小组第一次会议上，习近平强调，“网络信息是跨国界流动的，信息流引领技术流、资金流、人才流，信息资源日益成为重要生产要素和社会财富，信息掌握的多寡成为国家软实力和竞争力的重要标志”。而去年8月的深改组第四次会议通过了《关于推动传统媒体和新兴媒体融合发展的指导意见》，习近平要求“要着力打造一批形态多样、手段先进、具有竞争力的新型主流媒体，建成几家拥有强大实力和传播力、公信力、影响力的新型媒体集团”。</p><p style=\"margin-bottom: 0px; padding: 0px 0px 15px; line-height: 30px; text-indent: 2em; font-family: 宋体, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">北京市西城区信息办特聘专家、北工大信息与服务系统系主任石宇良对新京报记者说，新媒体的快速发展引发了媒体格局和社会生活的重大变化，正是基于这一背景，中央领导多次对新媒体发展做出部署。此前，中央对于新兴媒体的谋篇布局更多侧重于新媒体技术与传播，而本次中央统战工作会议则转向人，首次提到了“新媒体中的代表性人士”。</p><p style=\"margin-bottom: 0px; padding: 0px 0px 15px; line-height: 30px; text-indent: 2em; font-family: 宋体, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">“人是关键因素、核心因素。‘新媒体中的代表性人士’对于新媒体发展、媒体融合有重要影响，所以这部分人员特别是其中的党外人士，也正是爱国统一战线需要发展的人群，这也符合统一战线‘团结一切可以团结的力量’的宗旨”，石宇良表示，对于新媒体，之前各级宣传部门、各级组织部门做了大量工作，本次中央统战工作会议将“新媒体中的代表性人士”列为重要团结人群，相当于给统战工作部署了新任务，“鉴于新媒体的发展趋势，重点团结‘新媒体中的代表性人士’其实也是统战部门的常规性、基础性工作”。</p><p style=\"margin-bottom: 0px; padding: 0px 0px 15px; line-height: 30px; text-indent: 2em; font-family: 宋体, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">石宇良强调，新媒体传播的特点是“正反两面、泥沙俱下”，所以习近平在讲话中就如何重点团结“新媒体中的代表性人士”，作出了安排，“建立经常性联系渠道，加强线上互动、线下沟通”，并提出了希望，“让他们在净化网络空间、弘扬主旋律等方面展现正能量”。</p><p><br/></p>', '10081', '1', '招聘市场');
INSERT INTO `admin_xinxi` VALUES ('10014', '有二手机械要卖', '1433085778', '<p><img title=\"1433331570843012054.png\" alt=\"~_%25T~83N7N9A8SHXD0[7I.png\" src=\"http://101.200.174.101/upload/ueditor/20150603/1433331570843012054.png\"/></p>', '10061', '1', '二手机械');
INSERT INTO `admin_xinxi` VALUES ('10016', '学习标兵(十二月份)获奖会员', '1433162254', '<p style=\"text-align: center;\"><strong><span style=\"color: rgb(255, 0, 0);\"><span style=\"font-size: 28px;\"><span style=\"font-family: verdana,geneva,sans-serif;\">学习标兵(十二月份)获奖会员</span></span></span></strong></p><p>&nbsp;</p><p>&nbsp;</p><p style=\"text-align: center;\">生产线上摸爬滚打，汗水如雨飘洒</p><p style=\"text-align: center;\">不说那</p><p style=\"text-align: center;\">轮班抢修星光下，</p><p style=\"text-align: center;\">迎日出，送晚霞</p><p style=\"text-align: center;\">只看那</p><p style=\"text-align: center;\">整日灰头土脸，几个油污邋遢。</p><p style=\"text-align: center;\">说句心里话</p><p style=\"text-align: center;\">谁不愿穿名牌，讲品位</p><p style=\"text-align: center;\">装扮青春潇潇洒洒</p><p style=\"text-align: center;\">可既然来维修，既然选择他</p><p style=\"text-align: center;\">就要无畏风吹雨打，汗油交加</p><p style=\"text-align: center;\">为了那心中共同的希望，</p><p style=\"text-align: center;\">工服口罩，伴我春秋冬夏</p><p>&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp;他们来自人群，像一粒尘土，微薄微细，又随处可见。他们自认为渺小，却塑造了伟大；他们自认为平凡，却用双手修好了您的爱车。这就是我们身边最可爱、可敬的人——汽车维修工。</p><p>&nbsp; &nbsp; &nbsp; &nbsp;积土成山，风雨兴焉；积水成渊，蛟龙生焉。他们积累着点点滴滴的收获，堆积成自信的高峰。</p><p>&nbsp;</p><p>&nbsp;</p><p><strong>下面我们十二月的学习标兵们闪亮登场了：</strong></p><p>&nbsp;</p><p><strong>一等奖（10名）：</strong>朱茵、车修我、郝爱春、李大姐、朱朱a、guos886、老孙、光勇、zg8655792、yuan222</p><p>&nbsp;</p><p><img style=\"width: 650px; height: 425px;\" alt=\"\" src=\"http://www.zgxcw.com.cn/ckpic/images/1389952038.jpg\"/></p><p>&nbsp;</p><p><strong>二等奖（20名）：</strong>a叶、峰峰1、a新、657615459、ct、小程1、张雨、陈淑娟、yslj123、祁勇、xiaochao、莫小伟、原始、zaqxswcde、吴婕、小春、车修葛诸、二雪、李媛、做个有腹肌的大叔</p><p>&nbsp;</p><p><img style=\"width: 650px; height: 717px;\" alt=\"\" src=\"http://www.zgxcw.com.cn/ckpic/images/1389952412.jpg\"/></p><p>&nbsp;</p><p><strong>三等奖（10名）：</strong>LM祁鑫、pipi、文师傅、jrfdjgrr、ewq、bvc、uhb</p><p>&nbsp;</p><p><img style=\"width: 650px; height: 418px;\" alt=\"\" src=\"http://www.zgxcw.com.cn/ckpic/images/1389957687.jpg\"/></p><p>&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp;恭喜以上会员获得12月份学习标兵奖，感谢大家对诸葛修车网的信任与支持。欢迎更多的行业从业人员加入到诸葛修车网的会员行列，在这里共同学习、沟通交流和成长。</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p style=\"text-align: center;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;诸葛修车网运营团队</p><p style=\"text-align: center;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 2014年01月17日</p><p>&nbsp;</p>', '10081', '1', '招聘市场');
