--- 查出某一列
 select totalmoney from admin_order where user="11066";
-- 计算一列的总和
 select sum(totalmoney) FROM admin_order ;
-- 计算该条件下的 该列总和
 select sum(totalmoney) FROM admin_order where user="11066";
 -- 计算同一邀请码的总额列的金额总数
 select sum(zonge) from admin_jiaoyi_log where sysuser="TSX15110993";
 ---重复去重 distinct
 select distinct  c.user as user  from admin_jiaoyi_log c where sysuser='15110992';
 ---用 c的条件查询d的数据
 select  d.totalmoney as totalmoney  from admin_jiaoyi_log c ,admin_order d where  c.user=d.user and sysuser='15110992' ;
 ---既属于商家有属于邀请码
 select  sum(d.totalmoney) as totalmoney1  from admin_jiaoyi_log c ,admin_order d where  c.user=d.user and d.shangjia='10645' and sysuser='15110993' ;
 ---倒序查询
 SELECT * FROM `admin_jiaoyi_log` where  user= 10117  and  order by id DESC ;
 ---限制数量
 SELECT * FROM admin_jiaoyi_log   ORDER BY id DESC LIMIT 1
 ---改动所有消费企业的邀请码
 update admin_user set code='123456' where usertype='消费企业';
 
