---表一 用户表
CREATE TABLE `user` (
  `userid` int(11) DEFAULT NULL auto_increment COMMENT '用户ID',
  `username` varchar(255) DEFAULT NULL,
  `userrole` varchar(255) DEFAULT NULL COMMENT '用户角色',
  `xingming` varchar(255) DEFAULT NULL COMMENT '姓名',
  `password` varchar(255) DEFAULT NULL,
  `createtime` datetime DEFAULT NULL COMMENT '注册时间',
  `phone` varchar(255) DEFAULT NULL,
  `touxiangpic` varchar(255) DEFAULT NULL COMMENT '用户图片',
  `mail` varchar(255) DEFAULT NULL COMMENT '邮箱',
  `shenhe` varchar(11) DEFAULT NULL COMMENT '审核',
  `status` varchar(11) DEFAULT NULL COMMENT '状态',
  `score` int(11) DEFAULT NULL COMMENT '积分',
  `star` int(11) DEFAULT NULL COMMENT '实际得星',
  `lasttime` datetime DEFAULT NULL COMMENT '最近活动时间',
  `login_count` int(11) DEFAULT NULL COMMENT '登录次数',
  `shouldstar` int(11) DEFAULT NULL COMMENT '应得星',
  `tqcode` text,
  `del` int(11) DEFAULT NULL,
  PRIMARY KEY (`userid`)
) ENGINE=innodb DEFAULT CHARSET=utf8;
