---表五 文章内容
CREATE TABLE `article` (
	`articleid` int(11) DEFAULT NULL auto_increment COMMENT '文章ID',
  `author` int(11) DEFAULT NULL COMMENT '作者',
  `title` varchar(255) DEFAULT NULL COMMENT '文章标题',
  `content` text DEFAULT NULL COMMENT '文章内容',
	`articletype` int(11) DEFAULT NULL COMMENT '所属文章类型',
	`createtime` datetime DEFAULT NULL COMMENT '创建时间',
	`updatetime` datetime DEFAULT NULL COMMENT '最新修改时间',
	`is_discuss` boolean DEFAULT NULL COMMENT '是否被评论',
  `del` int(11) DEFAULT NULL,
  PRIMARY KEY (`articleid`)
) ENGINE=innodb DEFAULT CHARSET=utf8;
---表六  用户自定义文章类型
CREATE TABLE `user_article_type` (
	`articletypeid` int(11) DEFAULT NULL auto_increment COMMENT '文章类型ID',
  `articletypename` varchar(255) DEFAULT NULL COMMENT '文章类型名称',
  `userid` int(11) DEFAULT NULL COMMENT '所属用户ID',
  `del` int(11) DEFAULT NULL,
  PRIMARY KEY (`articletypeid`)
) ENGINE=innodb DEFAULT CHARSET=utf8;
---表七  评论表  
CREATE TABLE `discuss` (
	`discussid` int(11) DEFAULT NULL auto_increment COMMENT '评论ID',
	`discusscontent` text DEFAULT NULL COMMENT '评论内容',
  `discusstime` datetime DEFAULT NULL COMMENT '评论时间',
  `visitor` int(11) DEFAULT NULL COMMENT '访客ID',
  `userid` int(11) DEFAULT NULL COMMENT '所属用户ID',
  `del` int(11) DEFAULT NULL,
  PRIMARY KEY (`discussid`)
) ENGINE=innodb DEFAULT CHARSET=utf8;
---表八  文章评论表  
CREATE TABLE `article_discuss` (
	`articleid` int(11) DEFAULT NULL auto_increment COMMENT '文章ID',
	`discussid` int(11) DEFAULT NULL COMMENT '评论ID',
  `del` int(11) DEFAULT NULL,
  PRIMARY KEY (`articleid`,`discussid`)
) ENGINE=innodb DEFAULT CHARSET=utf8;
---表九 新闻表  
CREATE TABLE `news` (
	`newsid` int(11) DEFAULT NULL auto_increment COMMENT '新闻ID',
	`author` int(11) DEFAULT NULL COMMENT '作者',
  `title` varchar(255) DEFAULT NULL COMMENT '标题',
  `content` text DEFAULT NULL COMMENT '内容',
	`createtime` datetime DEFAULT NULL COMMENT '创建时间',
	`updatetime` datetime DEFAULT NULL COMMENT '最新修改时间',
  `del` int(11) DEFAULT NULL,
  PRIMARY KEY (`newsid`)
) ENGINE=innodb DEFAULT CHARSET=utf8;
---表十 公告表  
CREATE TABLE `notice` (
	`noticeid` int(11) DEFAULT NULL auto_increment COMMENT '公告ID',
	`author` int(11) DEFAULT NULL COMMENT '作者',
  `title` varchar(255) DEFAULT NULL COMMENT '标题',
  `content` text DEFAULT NULL COMMENT '内容',
	`createtime` datetime DEFAULT NULL COMMENT '创建时间',
	`updatetime` datetime DEFAULT NULL COMMENT '最新修改时间',
	`is_show` boolean DEFAULT NULL COMMENT '是否显示',
  `del` int(11) DEFAULT NULL,
  PRIMARY KEY (`noticeid`)
) ENGINE=innodb DEFAULT CHARSET=utf8;
---表十一 导航表 
CREATE TABLE `navi` (
  `naviid` int(11) DEFAULT NULL auto_increment COMMENT '导航ID',
  `naviname` varchar(255) DEFAULT NULL COMMENT '导航名',
  `createtime` int(11) DEFAULT NULL COMMENT '创建时间',
  `fuuser` int(11) DEFAULT NULL COMMENT '所属上级',
  `url` varchar(255) DEFAULT NULL,
  `type1` int(11) DEFAULT NULL COMMENT '所属1级分类',
  `type2` int(11) DEFAULT NULL COMMENT '所属2级分类',
  `type3` int(11) DEFAULT NULL COMMENT '所属3级分类',
  `base_weight` double DEFAULT '0' COMMENT '基本权重',
  `manual_weight` double DEFAULT '0' COMMENT '人工权重',
  PRIMARY KEY (`naviid`)
) ENGINE=innodb DEFAULT CHARSET=utf8;